function getCurrentUser(){var n=window.location.search;return new URLSearchParams(n).get("user")}function getCurrentSong(){var n=window.location.search;return new URLSearchParams(n).get("song")}function getSong(n){switch(n){case"Stefano":return"3.mp3";default:return"none"}}function getSongTitles(n){switch(n){case"1.mp3":return["a","b"];default:return"none"}}